"use strict";

function toGoatLatin(sentence) {
    let ans = [];
    sentence.split(' ').forEach((word, i) => {
        if (!['a', 'e', 'i', 'o', 'u'].includes(word[0].toLowerCase())) {
            word = word.slice(1) + word[0];
        }
        word += 'ma';
        word += 'a'.repeat(i + 1);
        ans.push(word);
    });
    return ans.join(' ');
}
